              <th></th>
            </tr>
          </thead>

          <tbody>
            {data
              ? data.map((obj, value) => (
                  <tr>
                    <td>{obj.examId}</td>
                    <td>{obj.examName}</td>
                    <td>{obj.description}</td>
                    {/* <td>{obj.creationDate}</td>
                    <td>{obj.expirationFate}</td>
                    <td>{obj.noOfQuestions}</td>
                    <td>{obj.durationMinutes}</td>
                    <td>{obj.passPercentage}</td> */}
                    {/* <td>{obj.questionsRandomized}</td> */}
                    {/* <td>{obj.answersMust}</td> */}

                    {/* <td>{obj.enableNegativeMark}</td> */}
                    {/* <td>{obj.negativeMarkValue}</td> */}
                    <td>
                      <button className="btn btn-primary">Edit</button>
                    </td>
                    <td>
                      <button
                        className="btn btn-primary"
                        onClick={() => {
                          examDetails(obj.examId);
                        }}
                      >
                        Details
                      </button>
                      {/* <button className="btn btn-primary" onClick={examDetails(obj.examId)}>Details</button> */}
                    </td>

                    <td>
                      <button
                        className="btn btn-danger"
                        onClick={() => deleteRows(value)}
                      >
                        Delete
                      </button>
                    </td>
                  </tr>
                ))
              : ""}
          </tbody>
        </table>
      </div>
      <div className="container my-5">
      <table className="table table-striped">
      <thead>
                <tr>
                  <th>Exam ID</th>
                  <th>Topic ID</th>
                  <th>Questions Per Exam</th>
                  <th>Percentage</th>
    
                  <th>Topic Pass Percentage</th>
                  <th>View Question</th>
                  <th>Delete</th>
                </tr>
              </thead>
              <tbody>

      {topicData ? (
        topicData.map((obj, value) => {
         return(
                <tr key={value}>
                  <td>{obj.examId}</td>
                  <td>{obj.topicId}</td>
                  <td>{obj.questionsPerExam}</td>
                  <td>{obj.percentage}</td>
    
                  <td>{obj.topicPassPercentage}</td>
                  <td><button className="btn btn-primary">View Question</button></td>
                 
                  <td><button className="btn btn-danger">Delete</button></td>
                </tr>
             
          
        )})
      ) : (
        <>No data</>
      )}
       </tbody>
            </table>
            </div>
            <button className="btn btn-primary offset-10" onClick={addAnotherTopic}>Add Another Topic</button>

    </div>
  );
};
export default ShowExams;
